import Head from 'next/head'
import Menu from '../components/menu';

export default function Ditastore() {
    return (
        <div>
            <Head>
                <title>Tentang Kami</title>
            </Head>
            <Menu />
                <div>
                    <h1>Tentang Kami</h1>
                    <h5>STIKOM PGRI Banyuwangi</h5>

                </div>
        </div>
    );
}
